import React from "react";
import { Card, Button } from "react-bootstrap";

export default function VaccinationCards({
  name,
  vaccineRecord,
  number,
  expiredDate,
  onDelete,
}) {
  return (
    <Card className="my-3">
      <Card.Body>
        <Card.Title>{name}</Card.Title>
        <Card.Subtitle className="mb-2 text-muted"> </Card.Subtitle>
        <Card.Text> Vaccination Record: {vaccineRecord}</Card.Text>
        <Card.Text>Vaccination Number: {number}</Card.Text>
        <Card.Text>Expired Date: {expiredDate}</Card.Text>
        <Button className="mt-3" variant="danger" onClick={onDelete}>
          Delete
        </Button>
      </Card.Body>
    </Card>
  );
}
